import React from 'react';
import ProductCard from './ProductCard';

const products = [
  {
    id: 1,
    name: 'Nameja gredzens',
    price: 79,
    image: 'https://balturotas.lv/storage/thumbs/products/607/product_image.jpg',
  },
  {
    id: 2,
    name: 'Sudraba aproce',
    price: 55,
    image: 'https://balturotas.lv/storage/thumbs/products/682/product_image.jpg',
  },
  {
    id: 3,
    name: 'Dzintara kulons',
    price: 42,
    image: 'https://balturotas.lv/storage/thumbs/products/123/product_image.jpg',
  },
];

const ProductList = () => {
  return (
    <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 max-w-6xl mx-auto px-4 pb-10">
      {products.map((product) => (
        <ProductCard key={product.id} product={product} />
      ))}
    </div>
  );
};

export default ProductList;
